Immerse yourself in history! Age of Empires (R) III Mobile is a historical Real Time Strategy game, faithful to the franchise history. Age of Empires (R) III Mobile delivers gameplay that is expected from the number 1 real-time strategy game on the PC. The game will place players in the position of defending Western Europe from the invading Ottoman Empire! 
==============================================================================
Продолжение эпохальной стратегии.
Вам предстоит на выбор - защитить Европу от вторжения Османской империи в свободной игре или играть в одиночные миссии.
Особенности игры:
- Два режима игры: свободная и кампания;
- бонусы для получения дополнительных ресурсов;
- 15 уровней в кампании, 11 разных юнитов с различными апгрейдами;
- Простая система управления которая максимально облегчит вам жизнь;
